extension CryptoListing: PropertyNames {
    func getData() {
        let list =  self.propertyNames()
        list.forEach { (data) in
            if let info = data as? (name:String, symbol:String) {
                print("(name:\"\(info.name)\", symbol:\"\(info.symbol)\"),")
            }
        }
    }
}
protocol PropertyNames {
    func propertyNames() -> [Any]
}

extension PropertyNames
{
    func propertyNames() -> [Any] {
        return Mirror(reflecting: self).children.compactMap { $0.value }
    }
}
